Clockwise 1986  with John Cleese



Brian Stimpson is de directeur van een school en extreem punctueel. Hij is nu uitgekozen om een grote onderwijsconferentie bij te wonen en is daar goed op voorbereid. Door een misverstand mist hij zijn trein en zet alles op alles om toch nog op tijd te komen, maar onderweg zetten steeds meer mensen de achtervolging in.


An uncompromising British school headmaster finds himself beset by one thing going wrong after another.


